import React from "react";
import './HexaOptions.scss'

export default function HexaOptions({text}) {

    
    return (
        <>
            <div className="HexaOptions" >
                <div className="frame" style={{}}>
                    <div>
                        <p>{text}</p>
                    </div>
                </div>
            </div>
        </>
    )
}
